class Solution {
    func incremovableSubarrayCount(_ nums: [Int]) -> Int {
        var count = 0

        for start in 0..<nums.count {
            for end in start..<nums.count {
                if isIncremovableSubarray(nums, start, end) {
                    count += 1
                }
            }
        }

        return count
    }

    private func isIncremovableSubarray(_ nums: [Int], _ start: Int, _ end: Int) -> Bool {
        var prev = start > 0 ? nums[start - 1] : Int.min
        for i in 0..<nums.count {
            if i >= start && i <= end {
                continue
            }
            if nums[i] <= prev {
                return false
            }
            prev = nums[i]
        }
        return true
    }
}
